import React from 'react'
import Header from './Header'
import Menu from './Menu'
import QuestionContainer from './QuestionContainer'

function App() {
  return (
    <React.Fragment>
      <Header />
      <Menu />
      <QuestionContainer />
    </React.Fragment>
  );
}

export default App;
